import React from "react";
import ReactDOM from "react-dom";
import { responsive_mock } from "./responsive.js";
export class Mocktest_list extends React.Component{
    constructor(props){
        super(props)
        this.state={arr:[['1','1','1','1'],['2','2','2','2']],style:responsive_mock.mocklist.main(10),header:responsive_mock.mocklist.header(),serial_no:responsive_mock.mocklist.serial_no(),title:responsive_mock.mocklist.title(),
        status:responsive_mock.mocklist.status(),difficulty:responsive_mock.mocklist.difficulty()}
    }
    resize(){
        this.setState({style:responsive_mock.mocklist.main(10),header:responsive_mock.mocklist.header()})
    }
    render(){
        return<div style={this.state.style}>
            <table>
                <tr style={this.state.header}>
                    <th style={this.state.serial_no}>S.No</th>
                    <th style={this.state.title}>Title</th>
                    <th style={this.state.status}>Status</th>
                    <th style={this.state.difficulty}>Difficulty</th>
                </tr>
                {this.state.arr.map((ele)=><Tablerow style={this.state.header}ele={ele}/>)}
            </table>
        </div>
    }
}
class Tablerow extends React.Component{
    constructor(props){
        super(props)
        this.state={serial_no:responsive_mock.mocklist.serial_no(),title:responsive_mock.mocklist.title(),status:responsive_mock.mocklist.status(),difficulty:responsive_mock.mocklist.difficulty()}
    }
    render(){
        return<tr style={this.props.style}>
            <td>{this.props.ele[0]}</td>
            <td>{this.props.ele[1]}</td>
            <td>{this.props.ele[2]}</td>
            <td>{this.props.ele[3]}</td>
        </tr>
    }
}
